query QueryRenderersCitySavedListQuery(
  $citySlug: String!
) {
  viewer {
    ...CitySavedList_viewer
  }
}

fragment CitySavedList_viewer on Viewer {
  city(slug: $citySlug) {
    name
  }
  me {
    followsAndSaves {
      shows(first: 20, status: RUNNING_AND_UPCOMING, city: $citySlug, after: "") {
        edges {
          node {
            id
            _id
            __id
            name
            isStubShow
            status
            href
            is_followed
            exhibition_period
            cover_image {
              url
            }
            location {
              coordinates {
                lat
                lng
              }
              __id
            }
            type
            start_at
            end_at
            partner {
              __typename
              ... on Partner {
                name
                type
                profile {
                  image {
                    url(version: "square")
                  }
                  __id
                }
              }
              ... on Node {
                __id
              }
              ... on ExternalPartner {
                __id
              }
            }
            __typename
          }
          cursor
        }
        pageInfo {
          endCursor
          hasNextPage
        }
      }
    }
    __id
  }
}
